import React from 'react';

const TableHead = () => {
    return (
        <thead>
            <tr>
                <th>Date</th>
                <th>Name</th>
                <th>Origin</th>
                <th>Amount</th>
                <th>Price</th>
            </tr>
       </thead>
    )
}


const OrderedProductsBody = ({products}) => { 
    return (
        <div className="orderedProductsBody">
            <table className="orderedProductsTableTitle">
                <TableHead />    

            </table>
        </div>
    )
}

export default OrderedProductsBody
